import React from 'react';
import {Input, Button} from '@material-ui/core';

function AirportListHeader(props) {
  return(
    <React.Fragment>
      <Input placeholder='Filter by name'/>
      <Button variant='contained' color='primary' onClick={props.toggleCreateModal}>Add new airport</Button>
    </React.Fragment>
  )
}

export default AirportListHeader;
